schemas.content:
# A type that describes lat lang cordinates.
type Point {
  floor: Int
}

input InputPoint {
  floor: Int!
}

type Reminder {
  enabled: Boolean!
  type: ReminderType
  schedule: [ReminderTime!]
}

input InputReminder {
  enabled: Boolean!
  type: ReminderType
  schedule: [InputReminderTime!]
}

enum ReminderType {
  MEDICINE
  REHAB
}

# A type describing a single lesson for the lessons screen
type Lesson {
  _id: ID!
  title: String!
  icon: String
}

input InputLesson {
    # optional id for when updating schedules
    _id: ID
    title: String!
    icon: String!
}

# A type describing reminder time in student schedule
type ReminderTime {
  # numeric chars (0, 1,...6) represents the dayIndex of remindertime
  daysindex: [Int!]
  hours: [String!]
}

input InputReminderTime {
  daysindex: [Int!]
  hours: [String!]
}

# A type describing a single time slot on the class/student schedule
type Original {
  # 2 numeric chars (0_0, 0_1...) represents the dayIndex_hourIndex of timeslot grid cell
  expired: String
  lesson: Lesson
  location: Location
}

input InputOriginal {
  expired: String!
  lesson: InputLesson
  location: InputLocation
}

type Settings {
  _id: ID!
  teachercode: Int
}

input InputSettings {
  teachercode: Int
}
